import './Main.css';
import Profile from "./Profile/Profile";
import Nav from "./Nav/Nav";
import Dialogs from "./Dialogs/Dialogs";
import {Route, BrowserRouter, Routes} from "react-router-dom";
import News from "./News/News";
import Music from "./Music/Music";
import Settings from "./Settings/Settings";

const Main = (props) => {
	let dialogs_data = [
		{'id': 1, 'name': 'Andrew'},
		{'id': 2, 'name': 'Dmitry'},
		{'id': 3, 'name': 'Sasha'},
		{'id': 4, 'name': 'Valera'},
		{'id': 5, 'name': 'Victor'},
		{'id': 6, 'name': 'Carl'},
		{'id': 7, 'name': 'Lera'},
		{'id': 8, 'name': 'Marat'},
		{'id': 9, 'name': 'Andrea'},
		{'id': 10, 'name': 'Vlad'},
	]
	return (
		<main className='main'>
			<Nav/>
			<div className="main__body">
				<Routes>
					<Route path="/profile/*" element={<Profile posts_data={ props.posts_data }/>}/>
					<Route path="/dialogs/*" element={<Dialogs dialogs_data={ props.dialogs_data }/>}/>
					<Route path="/news/*" element={<News/>}/>
					<Route path="/music/*" element={<Music/>}/>
					<Route path="/settings/*" element={<Settings/>}/>
				</Routes>
			</div>
		</main>
	)
}

export default Main;
